		["Def - IP Tracker"] = {
			["text2Point"] = "TOP",
			["text1FontSize"] = 15,
			["color"] = {
				1, -- [1]
				1, -- [2]
				1, -- [3]
				1, -- [4]
			},
			["customText"] = "function()\n    \n    -- Never Surrender\n    local curHP = UnitHealth(\"player\")\n    local maxHP = UnitHealthMax(\"player\")\n    local percHPMissing = (maxHP - curHP) / maxHP\n    local _, _, _, hasNS = GetTalentInfo(4, 2, 1)\n    local NSPerc = hasNS and (1 + percHPMissing) or 1\n    \n    local currentIP = select(16, WA_GetUnitBuff(\"player\", 190456)) or 0\n    \n    local castIP = tonumber((GetSpellDescription(190456):match(\"%%.+%d\"):gsub(\"%D\",\"\"))) * NSPerc\n    \n    local IPCap = math.floor(castIP * 1.3)\n    \n    local percentOfCap = currentIP / IPCap * 100\n    percentOfCap = aura_env.shortenPercent(percentOfCap)\n    \n    local additionalAbsorb = IPCap - currentIP\n    \n    local percentOfMaxHP = currentIP / UnitHealthMax(\"player\") * 100\n    percentOfMaxHP = aura_env.shortenPercent(percentOfMaxHP)\n    \n    local inCombat = WeakAuras.triggerState[aura_env.id].triggers[2]\n    \n    if aura_env.saturateBasedOnRage then\n        \n        if UnitPower(\"player\") >= GetSpellPowerCost(190456)[1].cost then\n            aura_env.region:SetDesaturated(false)\n        else\n            aura_env.region:SetDesaturated(true)\n        end\n        \n    else\n        \n        if currentIP == 0 then\n            aura_env.region:SetDesaturated(true)\n        else\n            aura_env.region:SetDesaturated(false)\n        end\n    end\n    \n    if currentIP + castIP <= IPCap then\n        \n        aura_env.setVisuals(aura_env.fullCastColor[1],aura_env.fullCastColor[2],aura_env.fullCastColor[3], aura_env.glowEffect and inCombat)\n        \n    elseif IPCap - currentIP > 0 then\n        \n        aura_env.setVisuals(aura_env.capColor[1],aura_env.capColor[2],aura_env.capColor[3], false)\n        \n    elseif IPCap - currentIP <= 0 then\n        \n        aura_env.setVisuals(aura_env.clipColor[1],aura_env.clipColor[2],aura_env.clipColor[3], false)\n    end\n    \n    if aura_env.shortenAbsorbText then\n        currentIP = aura_env.shortenNumber(currentIP)\n        additionalAbsorb = aura_env.shortenNumber(additionalAbsorb)\n    end\n    \n    local text1 = \"\"\n    \n    if aura_env.text1 == \"absorb\" then\n        text1 = currentIP\n    elseif aura_env.text1 == \"percent\" then\n        text1 = percentOfCap\n    elseif aura_env.text1 == \"additional\" then\n        text1 = additionalAbsorb\n    elseif aura_env.text1 == \"percentofhp\" then\n        text1 = percentOfMaxHP\n    end\n    \n    local text2 = \"\"\n    \n    if aura_env.text2 == \"absorb\" then\n        text2 = currentIP\n    elseif aura_env.text2 == \"percent\" then\n        text2 = percentOfCap\n    elseif aura_env.text2 == \"additional\" then\n        text2 = additionalAbsorb\n    elseif aura_env.text2 == \"percentofhp\" then\n        text2 = percentOfMaxHP\n    end\n    \n    return text1, text2\nend",
			["yOffset"] = 72,
			["anchorPoint"] = "CENTER",
			["customTextUpdate"] = "update",
			["url"] = "https://wago.io/IgnorePainTracker/10",
			["actions"] = {
				["start"] = {
				},
				["finish"] = {
				},
				["init"] = {
					["custom"] = "-- by Marok (v2.01)\n\n---- User Options ----\n\n-- Any options that are true or false can be turned on and off by setting them to either true or false. All the options and what they do are explained below.\n\n--- Text Output ---\n\n-- text1 and text2 are the two text fields that appear on the icon. By default, text1 is centered on the icon and text2 is on top and outside the icon.\n-- You can set text1 and text2 to any combination of the available options.\n\n-- Text Options -- These must be inside of quotes (\"\") and are case sensitive.\n\n-- \"absorb\" - Displays your remaining Ignore Pain absorb amount.\n-- \"percent\" - Displays at what percent of the Ignore Pain cap you are at.\n-- \"additional\" - Displays how much Ignore Pain absorb you will gain by casting it.\n-- \"percentofhp\" - Displays the percent of your max health that Ignore Pain is making up.\n-- \"none\" - Displays nothing.\n\naura_env.text1 = \"absorb\"\naura_env.text2 = \"additional\"\n\n--- Text Color Toggle ---\n\n-- These options control whether or not text1/text2 are colored according to the clip/capping rules. If set to false, the text remains white (or whatever color you set in the Display tab).\n\naura_env.colorText1 = true\naura_env.colorText2 = false\n\n--- Text Color ---\n\n-- You can change the color for each status of Ignore Pain. Values are r, g, b, respectively, and range from 0 to 1.\n\n-- fullCastColor is the color you will see when casting Ignore Pain grants you full absorb.\n-- capColor is the color you will see when casting Ignore Pain grants you partial absorb.\n-- clipColor is the color you will see when casting Ignore Pain grants you no absorb or causes you to lose absorb.\n\naura_env.fullCastColor = {1, 1, 1} -- Default (Green): {1, 1, 1}\naura_env.capColor = {1, 1, 0} -- Default (Yellow): {1, 1, 0}\naura_env.clipColor = {1, 0, 0} -- Default (Red): {1, 0, 0}\n\n--- Glow Effect ---\n\n-- Causes the icon to glow if casting Ignore Pain grants you full absorb.\n\naura_env.glowEffect = true\n\n--- Saturate Based on Rage ---\n\n-- By default the icon is saturated (has color) when Ignore Pain is up, and desaturated when Ignore Pain is down.\n-- This option will instead saturate the icon when you have enough Rage to cast Ignore Pain and desaturate it when you don't.\n\naura_env.saturateBasedOnRage = false\n\n--- Absorb Text Formatting ---\n\n-- The following three options apply to the \"absorb\" and \"additional\" text options.\n\n-- shortenAbsorbText shortens text from 13,500 to 13.5k, for example.\n-- By default, text is always shortened to three numbers. That is, 5,500 is shortened to 5.50k, 15,500 is shortened to 15.5k.\n\n-- numberOfDecimalPlaces allows you to force a certain number of decimal places to always be displayed. This option has no effect if shortenAbsorbText isn't enabled.\n-- This can be set from 0 to 3.\n\n-- dontShortenThousands displays absorb amounts between 1,000 and 10,000 without shortening them. For example, 5,000 shows as 5,000, but 12,000 shows as 12.0k (or according to numberOfDecimalPlaces).\n\naura_env.shortenAbsorbText = true\naura_env.numberOfDecimalPlaces = false -- This can also be set to false to re-enable the default text shortening.\naura_env.dontShortenThousands = false\n\n--- Percent Text Formatting --\n\n-- This option applies to the \"percent\" and \"percentofhp\" text options.\n-- percentNumOfDecimalPlaces forces a certain number of decimal places to always be displayed.\n-- This can be set from 0 to 2.\n\naura_env.percentNumOfDecimalPlaces = 0\n\n---- Do not touch anything below this line! ----\n\naura_env.setVisuals = function(r,g,b, glow)\n    \n    local region = aura_env.region\n    \n    if aura_env.colorText1 then\n        region.stacks:SetTextColor(r,g,b,1)\n    end\n    \n    if aura_env.colorText2 then\n        region.text2:SetTextColor(r,g,b,1)\n    end\n    \n    region:SetGlow(glow)\nend\n\nlocal round = function(num, numDecimalPlaces)\n    local mult = 10^(numDecimalPlaces or 0)\n    return math.floor(num * mult + 0.5) / mult\nend\n\naura_env.shortenNumber = function(number)\n    \n    local shortenedNumber = number\n    \n    local suffix = \"\"\n    if number >= 1000000 then\n        shortenedNumber = shortenedNumber / 1000000\n        suffix = \"m\"\n    elseif number >= 1000 then\n        shortenedNumber = shortenedNumber / 1000\n        suffix = \"k\"\n    end\n    \n    if not aura_env.numberOfDecimalPlaces then\n        \n        if number >= 100000000 then\n            shortenedNumber = round(shortenedNumber, 0)\n            \n        elseif number >= 10000000 then\n            shortenedNumber = round(shortenedNumber, 1)\n            \n            if shortenedNumber == math.floor(shortenedNumber) then\n                shortenedNumber = shortenedNumber..\".0\"\n            end\n            \n        elseif number >= 1000000 then\n            shortenedNumber = round(shortenedNumber, 2)\n            \n            if shortenedNumber == math.floor(shortenedNumber) then\n                shortenedNumber = shortenedNumber..\".00\"\n            elseif shortenedNumber == round(shortenedNumber, 1) then\n                shortenedNumber = shortenedNumber..\"0\"\n            end\n            \n        elseif number >= 100000 then\n            shortenedNumber = round(shortenedNumber, 0)\n            \n        elseif number >= 10000 then\n            shortenedNumber = round(shortenedNumber, 1)\n            \n            if shortenedNumber == math.floor(shortenedNumber) then\n                shortenedNumber = shortenedNumber..\".0\"\n            end\n            \n        elseif number >= 1000 then\n            shortenedNumber = round(shortenedNumber, 2)\n            \n            if shortenedNumber == math.floor(shortenedNumber) then\n                shortenedNumber = shortenedNumber..\".00\"\n            elseif shortenedNumber == round(shortenedNumber, 1) then\n                shortenedNumber = shortenedNumber..\"0\"\n            end\n        end\n        \n    else\n        \n        if number >= 1000 then\n            \n            shortenedNumber = round(shortenedNumber, aura_env.numberOfDecimalPlaces)\n            \n            if aura_env.numberOfDecimalPlaces > 0 then\n                \n                if shortenedNumber == math.floor(shortenedNumber) then\n                    \n                    local zeroSuffix = \".\"\n                    \n                    for i=1,aura_env.numberOfDecimalPlaces do\n                        zeroSuffix = zeroSuffix..\"0\"\n                    end\n                    \n                    shortenedNumber = shortenedNumber..zeroSuffix\n                    \n                elseif aura_env.numberOfDecimalPlaces > 1 and shortenedNumber == round(shortenedNumber, 1) then\n                    \n                    for i=1,aura_env.numberOfDecimalPlaces-1 do\n                        shortenedNumber = shortenedNumber..\"0\"\n                    end\n                    \n                elseif aura_env.numberOfDecimalPlaces > 2 and shortenedNumber == round(shortenedNumber, 2) then\n                    \n                    shortenedNumber = shortenedNumber..\"0\"\n                end\n            end\n        end\n    end\n    \n    if aura_env.dontShortenThousands and (number >= 1000 and number < 10000) then    \n        return number\n    else\n        return shortenedNumber..suffix\n    end\nend\n\naura_env.shortenPercent = function(number)\n    \n    local shortenedNumber = number\n    \n    shortenedNumber = round(shortenedNumber, aura_env.percentNumOfDecimalPlaces)\n    \n    if aura_env.percentNumOfDecimalPlaces > 0 then\n        \n        if shortenedNumber == math.floor(shortenedNumber) then\n            \n            local zeroSuffix = \".\"\n            \n            for i=1,aura_env.percentNumOfDecimalPlaces do\n                zeroSuffix = zeroSuffix..\"0\"\n            end\n            \n            shortenedNumber = shortenedNumber..zeroSuffix\n            \n        elseif aura_env.percentNumOfDecimalPlaces > 1 and shortenedNumber == round(shortenedNumber, 1) then\n            shortenedNumber = shortenedNumber..\"0\"\n        end\n    end\n    \n    if number <= 0 then\n        shortenedNumber = 0\n    end\n    \n    return shortenedNumber..\"%\"\nend\n\nlocal checkOptions = function()\n    \n    aura_env.text1 = (not (\"absorb\" or \"percent\" or \"additional\" or \"percentofhp\" or \"none\")) and \"none\" or aura_env.text1\n    aura_env.text2 = (not (\"absorb\" or \"percent\" or \"additional\" or \"percentofhp\" or \"none\")) and \"none\" or aura_env.text2\n    \n    aura_env.colorText1 = (not (type(aura_env.colorText1) == \"boolean\")) and true or aura_env.colorText1\n    aura_env.colorText2 = not (not (type(aura_env.colorText2) == \"boolean\")) and aura_env.colorText2 or false\n    \n    aura_env.fullCastColor = (not (type(aura_env.fullCastColor) == \"table\")) and {1, 1, 1} or aura_env.fullCastColor\n    aura_env.capColor = (not (type(aura_env.capColor) == \"table\")) and {1, 1, 0} or aura_env.capColor\n    aura_env.clipColor = (not (type(aura_env.clipColor) == \"table\")) and {1, 0, 0} or aura_env.clipColor\n    \n    aura_env.glowEffect = not (not (type(aura_env.glowEffect) == \"boolean\")) and aura_env.glowEffect or false\n    \n    aura_env.saturateBasedOnRage = not (not (type(aura_env.saturateBasedOnRage) == \"boolean\")) and aura_env.saturateBasedOnRage or false\n    \n    aura_env.shortenAbsorbText = (not (type(aura_env.shortenAbsorbText) == \"boolean\")) and true or aura_env.shortenAbsorbText\n    if not (aura_env.numberOfDecimalPlaces == false) then\n        aura_env.numberOfDecimalPlaces = (not (type(aura_env.numberOfDecimalPlaces) == \"number\")) and 1 or aura_env.numberOfDecimalPlaces\n        aura_env.numberOfDecimalPlaces = math.floor(aura_env.numberOfDecimalPlaces)\n        aura_env.numberOfDecimalPlaces = aura_env.numberOfDecimalPlaces < 0 and 0 or aura_env.numberOfDecimalPlaces\n        aura_env.numberOfDecimalPlaces = aura_env.numberOfDecimalPlaces > 3 and 3 or aura_env.numberOfDecimalPlaces\n    end\n    aura_env.dontShortenThousands = not (not (type(aura_env.dontShortenThousands) == \"boolean\")) and aura_env.dontShortenThousands or false\n    \n    aura_env.percentNumOfDecimalPlaces = (not (type(aura_env.percentNumOfDecimalPlaces) == \"number\")) and 0 or aura_env.percentNumOfDecimalPlaces\n    aura_env.percentNumOfDecimalPlaces = math.floor(aura_env.percentNumOfDecimalPlaces)\n    aura_env.percentNumOfDecimalPlaces = aura_env.percentNumOfDecimalPlaces < 0 and 0 or aura_env.percentNumOfDecimalPlaces\n    aura_env.percentNumOfDecimalPlaces = aura_env.percentNumOfDecimalPlaces > 2 and 2 or aura_env.percentNumOfDecimalPlaces\nend\ncheckOptions()",
